import { Fragment } from 'react';
import iFactura from '../Interfaces/Interfaces';


const ListarFacturas = (facturas: iFactura[]) => {
    return(
        <Fragment>
            facturas.map((factura: iFactura) => {
                <h3>{factura}</h3>
}
        </Fragment>
    )

}


export default ListarFacturas;
